(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d21e5b3"],{d4e2:function(t){t.exports=JSON.parse('{"created_at":"2020-07-21T23:15:53+08:00","excerpt":"证明：加法循环群 $G = \\\\{ka \\\\bmod b | \\\\forall k\\\\}$的元素个数为$\\\\frac{b}{gcd(a, b)}$","html":"<h2 id=\\"_1\\">群论</h2>\\n<p>证明：加法循环群 <script type=\\"math/tex\\">G = \\\\{ka \\\\bmod b | \\\\forall k\\\\}<\/script>的元素个数为<script type=\\"math/tex\\">\\\\frac{b}{gcd(a, b)}<\/script>\\n</p>\\n<h2 id=\\"_2\\">多项式</h2>\\n<p>秦九韶算法（Horner法则）\\n<script type=\\"math/tex; mode=display\\">\\n\\\\begin{aligned}\\nA(x) &= \\\\sum_{i=0}^{n-1} a_i x^i \\\\\\\\\\n&= a_0 + x(\\\\sum_{i=0}^{n-2} a_{i+1} x^i) \\\\\\\\\\n&= a_0 + \\\\left(a_1 + ...\\\\left(a_{n-2} + a_{n-1}x\\\\right)...\\\\right)x\\n\\\\end{aligned}\\n<\/script>\\n</p>\\n<p>定理（代数基本定理）非零n次多项式恰有n个根（含重根）</p>\\n<p>证明</p>\\n<p>定理（多项式插值的唯一性）  任意n个x坐标不同的点<script type=\\"math/tex\\">(x_i, y_i), i=1, ..., n<\/script>，可唯一确定一个n-1次多项式</p>\\n<p>证明  假设存在两个包含这n个点的n-1次多项式p(x)和q(x)，则他们的差<script type=\\"math/tex\\">r(x)=p(x)-q(x)<\/script>为至多n-1次多项式。因为<script type=\\"math/tex\\">r(x_i) = y_i-y_i = 0<\/script>，故n-1次多项式<script type=\\"math/tex\\">r(x)<\/script>有n个不同根，故<script type=\\"math/tex\\">r(x)=0<\/script>。</p>","tags":["math","notes"],"title":"代数笔记","updated_at":"2020-07-21T23:15:53+08:00","url":"/docs/course/algebra"}')}}]);
